Всем привет!)
Компания Интегроматика, бренд RiskService - разрабатывает аналитическую систему анализа внутренних и внешних данных о компаниях с целью выявления экономических рисков и предотвращения мошенничества.
В настоящее время в компанию требуется 1-2 Java-программиста с реальной перспективой роста. Мы гибко подходим к выбору кандидата и готовы рассмотреть всех желающих, главное, чтобы человек был целеустремлён, готов брать на себя ответственность за результат своей работы и стремился расти и развиваться. 
Обязанности:
- Полное понимание всех компонентов системы;
- Описание технического решения и оценка тех требований;
- Исправление выявленных ошибок;
- Ведение документации, логов разработки и пр.
Ключевые навыки:
- программирование на Java от 3-х лет;
- PostgreSQL;
- будет плюсом опыт настройки Java-

приложений и знакомство со стеком ELK(Elasticsearch/Logstash/Kibana);
- опытный пользователь Atlassian Jira;
Вилка:90-150 тр (по результатам собеседования)
- 5/2, офис м. Новослободская
- испытательный срок
